import React, { useState } from 'react';
import { useCart } from '../context/CartContext';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const { getCartCount } = useCart();

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
      setIsOpen(false); // Close mobile menu after clicking
    }
  };

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
    setIsOpen(false);
  };

  return (
    <nav className="shadow-lg sticky top-0 z-50" style={{ backgroundColor: '#E6C9A2' }}>
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <button onClick={scrollToTop} className="flex items-center space-x-2">
            <svg width="32" height="32" viewBox="0 0 640 512" className="fill-coffee-brown">
              <path d="M192 384h192c53 0 96-43 96-96h32c70.6 0 128-57.4 128-128S582.6 32 512 32H120c-13.3 0-24 10.7-24 24v232c0 53 43 96 96 96zM512 96c35.3 0 64 28.7 64 64s-28.7 64-64 64h-32V96h32zm47.7 384H48.3c-47.6 0-61-64-36-64h583.3c25 0 11.8 64-35.9 64z"></path>
            </svg>
            <span className="font-playfair text-2xl font-bold text-coffee-brown">
              EstateDeli
            </span>
          </button>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8">
            <button 
              onClick={scrollToTop}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              Home
            </button>
            <button 
              onClick={() => scrollToSection('about')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              About
            </button>
            <button 
              onClick={() => scrollToSection('menu')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              Menu
            </button>
            <button 
              onClick={() => scrollToSection('shop')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              Shop
            </button>
            <button 
              onClick={() => scrollToSection('contact')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium"
            >
              Contact
            </button>
          </div>

          {/* Right side - Cart and Login */}
          <div className="flex items-center space-x-3">
            {/* Cart Button */}
            <button className="bg-coffee-brown text-white px-4 py-2 rounded-lg hover:bg-coffee-dark transition-all duration-300 font-medium shadow-md hover:shadow-lg transform hover:scale-105 flex items-center space-x-2">
              <svg width="16" height="16" viewBox="0 0 576 512" className="fill-white">
                <path d="M528.12 301.319l47.273-208C578.806 78.301 567.391 64 551.99 64H159.208l-9.166-44.81C147.758 8.021 137.93 0 126.529 0H24C10.745 0 0 10.745 0 24v16c0 13.255 10.745 24 24 24h69.883l70.248 343.435C147.325 417.1 136 435.222 136 456c0 30.928 25.072 56 56 56s56-25.072 56-56c0-15.674-6.447-29.835-16.824-40h209.647C430.447 426.165 424 440.326 424 456c0 30.928 25.072 56 56 56s56-25.072 56-56c0-22.172-12.888-41.332-31.579-50.405l5.517-24.276c3.413-15.018-8.002-29.319-23.403-29.319H218.117l-6.545-32h293.145c11.206 0 20.92-7.754 23.403-18.681z"></path>
              </svg>
              <span className="text-sm">Cart</span>
              {getCartCount() > 0 && (
                <span className="bg-red-500 text-white text-xs rounded-full h-5 w-5 flex items-center justify-center">
                  {getCartCount()}
                </span>
              )}
            </button>

            {/* Login Button */}
            <button className="bg-coffee-brown text-white px-4 py-2 rounded-lg hover:bg-coffee-dark transition-all duration-300 font-medium shadow-md hover:shadow-lg transform hover:scale-105">
              Login
            </button>

            {/* Mobile menu button */}
            <button 
              className="md:hidden p-2"
              onClick={() => setIsOpen(!isOpen)}
            >
              <div className="w-6 h-6 flex flex-col justify-center items-center">
                <span className={`bg-coffee-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm ${isOpen ? 'rotate-45 translate-y-1' : '-translate-y-0.5'}`}></span>
                <span className={`bg-coffee-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm my-0.5 ${isOpen ? 'opacity-0' : 'opacity-100'}`}></span>
                <span className={`bg-coffee-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm ${isOpen ? '-rotate-45 -translate-y-1' : 'translate-y-0.5'}`}></span>
              </div>
            </button>
          </div>
        </div>

        {/* Mobile Navigation */}
        <div className={`md:hidden ${isOpen ? 'block' : 'hidden'}`}>
          <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3" style={{ backgroundColor: '#E6C9A2' }}>
            <button 
              onClick={scrollToTop}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              Home
            </button>
            <button 
              onClick={() => scrollToSection('about')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              About
            </button>
            <button 
              onClick={() => scrollToSection('menu')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              Menu
            </button>
            <button 
              onClick={() => scrollToSection('shop')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              Shop
            </button>
            <button 
              onClick={() => scrollToSection('contact')}
              className="text-coffee-brown hover:text-coffee-dark transition-all duration-300 font-medium block px-3 py-2 rounded-md text-base w-full text-left"
            >
              Contact
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
